import React from 'react';
import s from './Navbar.module.css';
import {NavLink} from "react-router-dom";

const Navbar = () => {
	return (
		<nav className={s.nav}>
			<div>
				<NavLink to="/profile" className={`${s.item} ${s.active}`}>Profile</NavLink>
			</div>
			<div>
				<a href="/dialogs" className={s.item}>Messages</a>
			</div>
			<div>
				<a href="/news" className={s.item}>News</a>
			</div>
			<div>
				<a href="#" className={s.item}>Music</a>
			</div>
			<div>
				<a href="#" className={s.item}>Settings</a>
			</div>
		</nav>
	);
};

export default Navbar;
